import React from "react";

const FullScreenHeaderAndSidebar = () => {
  return (
    <Wrapper>
      <Sidebar
        className="Sidebar"
        style={{ backgroundColor: "white", marginTop: "1px" }}>
        <h4 style={{ textAlign: "center" }}>Data Structure ({subject.code})</h4>
        <Menu>
          <MenuItem
            className="menu-item"
            component={<Link to="/dashboard" />}
            icon={<GridViewOutlinedIcon />}>
            Dashboard
          </MenuItem>
          <MenuItem
            className="menu-item"
            icon={<VideoCameraFrontOutlinedIcon />}
            onClick={() => {
              setSelectMenuItem("lecture");
            }}>
            Lecture
          </MenuItem>
          <MenuItem
            className="menu-item"
            icon={<ChatOutlinedIcon />}
            onClick={() => setSelectMenuItem("chat")}>
            Chat
          </MenuItem>
          <MenuItem
            className="menu-item"
            icon={<FolderOutlinedIcon />}
            onClick={() => setSelectMenuItem("files")}>
            Files
          </MenuItem>
          <MenuItem
            className="menu-item"
            icon={<CalendarMonthOutlinedIcon />}
            onClick={() => setSelectMenuItem("calendar")}>
            Calendar
          </MenuItem>
        </Menu>
      </Sidebar>
      {components[selectMenuItem]}
    </Wrapper>
  );
};

export default FullScreenHeaderAndSidebar;
